window.bookSummaryJSON = "<p><b>The Omega Creed has fallenâ€”but there's one more story to be told.</b></p> <p>Five years after the collapse of the Omega Creed, Gabrielle is fighting to survive in a world that still doesn't trust omegas, no matter what the law says.</p> <p>Cade, Axel, Hudson, and Nate have everything they need. Success, money, power, even fame. But when they come across a desperate Gabrielle in need of their help, the alpha pack starts to realize what they're missing.</p> <p>Gabrielle doesn't trust alphas. But this pack isn't giving up.</p> <p>Join Gabrielle and her pack for the final tale of the Omega War.</p> <p><i>This book is an interconnected standalone and can be listened to separately from the rest of the series.</i></p>"; 
